import React, { useState} from 'react';
import Header from '../../components/header/header';
import api from '../../services/api';
import { FiSearch } from 'react-icons/fi';


import './style.css';
import '../../globalStyle/style.css';




export default function Product(){

    const [product, setProduct] = useState();


    const getData = async (
        id,
        produto,
        estoque,
        valor_venda,
        status,
        unidade_comercial,
        qtde_promocional,
        fator,
    ) => {
        let res = await api.get("/produtos", {
            params: {
                id: id,
                produto: produto,
                estoque: estoque,
                valor_venda: valor_venda,
                status: status,
                unidade_comercial: unidade_comercial,
                qtde_promocional: qtde_promocional,
                fator: fator, 
            }
        })
        setProduct(res.data);
        console.log(product);
    }

    return(
        <div className="content">
            <div className="container">
                <Header />
                <div className="products">
                    <div className="wrapper">
                        <p>Produtos</p>
                        <input type="text" placeholder="Codigo, descrição"></input>
                        {/* <button type="button" onClick={() => SearchProduct()}> */}
                            <FiSearch size={20} color="#ffffff" />
                        {/* </button> */}
                    </div>
                    
                    <div class="product">
                        <p>ID: </p>
                        <p>Descrição: </p>
                        <p>valor venda: 10.00</p>
                        <p>Estoque: 5</p>
                        <p>Fator: 1</p>
                        <p>QTD promo: 10</p>
                        <p>Valor promo:4</p>
                    </div>
                   
                </div>
                
            </div>
        </div>
        
    );
    
}
